import { useEffect } from "react"

export default function login(props){
    let userid=props.userid
    let password=props.pass
    console.log('http://127.0.0.1:5000/api/login/'+{userid}+'/'+{password})
    
        fetch('http://127.0.0.1:5000/api/login/${userid}/${password}')  // API endpoint of your Flask server
          .then(response => response.json())
          .then(data => {
            data.map(item=>(
              console.log(item)
            ))
          })
          .catch(error => {
            console.error('Error:', error);
          });
      

}
